import React, { useState, useEffect } from "react";
import axios from "axios";
import {
  Container,
  TextField,
  MenuItem,
  Button,
  Typography,
  Grid,
  Box,
} from "@mui/material";

const Register = () => {
  const [countries, setCountries] = useState([]);
  const [states, setStates] = useState([]);
  const [cities, setCities] = useState([]);

  const [selectedCountry, setSelectedCountry] = useState("");
  const [selectedState, setSelectedState] = useState("");
  const [selectedCity, setSelectedCity] = useState("");

  const [formData, setFormData] = useState({
    name: "",
    email: "",
    password: "",
  });

  const apiKey = process.env.REACT_APP_CSCAPI_KEY;
  const apiUrl = "https://api.countrystatecity.in/v1";

  // Fetch Countries
  useEffect(() => {
    const fetchCountries = async () => {
      try {
        const response = await axios.get(`${apiUrl}/countries`, {
          headers: { "X-CSCAPI-KEY": apiKey },
        });
        const countryList = response.data.map((country) => ({
          name: country.name,
          code: country.iso2,
        }));
        setCountries(countryList.sort((a, b) => a.name.localeCompare(b.name)));
      } catch (error) {
        console.error("Error fetching countries:", error);
      }
    };
    fetchCountries();
  }, [apiKey]);

  // Fetch States
  useEffect(() => {
    if (selectedCountry) {
      const fetchStates = async () => {
        try {
          const response = await axios.get(
            `${apiUrl}/countries/${selectedCountry}/states`,
            {
              headers: { "X-CSCAPI-KEY": apiKey },
            }
          );
          setStates(response.data);
          setSelectedState("");
          setCities([]); // Reset cities
        } catch (error) {
          console.error("Error fetching states:", error);
        }
      };
      fetchStates();
    }
  }, [selectedCountry, apiKey]);

  // Fetch Cities
  useEffect(() => {
    if (selectedState) {
      const fetchCities = async () => {
        try {
          const response = await axios.get(
            `${apiUrl}/countries/${selectedCountry}/states/${selectedState}/cities`,
            {
              headers: { "X-CSCAPI-KEY": apiKey },
            }
          );
          setCities(response.data);
          setSelectedCity(""); // Reset city
        } catch (error) {
          console.error("Error fetching cities:", error);
        }
      };
      fetchCities();
    }
  }, [selectedState, selectedCountry, apiKey]);

  const handleInputChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value,
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log("Form Data:", formData);
    console.log("Country:", selectedCountry);
    console.log("State:", selectedState);
    console.log("City:", selectedCity);
  };

  return (
    <Container maxWidth="sm" sx={{ mt: 5 }}>
      <Typography variant="h4" align="center" gutterBottom>
        Register for Pickleball
      </Typography>
      <Box component="form" onSubmit={handleSubmit} noValidate sx={{ mt: 2 }}>
        <TextField
          fullWidth
          label="Name"
          variant="outlined"
          margin="normal"
          name="name"
          value={formData.name}
          onChange={handleInputChange}
          required
        />
        <TextField
          fullWidth
          label="Email"
          variant="outlined"
          margin="normal"
          type="email"
          name="email"
          value={formData.email}
          onChange={handleInputChange}
          required
        />
        <TextField
          fullWidth
          label="Password"
          variant="outlined"
          margin="normal"
          type="password"
          name="password"
          value={formData.password}
          onChange={handleInputChange}
          required
        />

        {/* Country Dropdown */}
        <TextField
          select
          fullWidth
          label="Country"
          variant="outlined"
          margin="normal"
          value={selectedCountry}
          onChange={(e) => setSelectedCountry(e.target.value)}
          required
        >
          <MenuItem value="">
            <em>Select Country</em>
          </MenuItem>
          {countries.map((country) => (
            <MenuItem key={country.code} value={country.code}>
              {country.name}
            </MenuItem>
          ))}
        </TextField>

        {/* State Dropdown */}
        {states.length > 0 && (
          <TextField
            select
            fullWidth
            label="State"
            variant="outlined"
            margin="normal"
            value={selectedState}
            onChange={(e) => setSelectedState(e.target.value)}
            required
          >
            <MenuItem value="">
              <em>Select State</em>
            </MenuItem>
            {states.map((state) => (
              <MenuItem key={state.iso2} value={state.iso2}>
                {state.name}
              </MenuItem>
            ))}
          </TextField>
        )}

        {/* City Dropdown */}
        {cities.length > 0 && (
          <TextField
            select
            fullWidth
            label="City"
            variant="outlined"
            margin="normal"
            value={selectedCity}
            onChange={(e) => setSelectedCity(e.target.value)}
            required
          >
            <MenuItem value="">
              <em>Select City</em>
            </MenuItem>
            {cities.map((city) => (
              <MenuItem key={city.iso2} value={city.iso2}>
                {city.name}
              </MenuItem>
            ))}
          </TextField>
        )}

        <Button
          type="submit"
          variant="contained"
          color="primary"
          fullWidth
          sx={{ mt: 3, mb: 2 }}
        >
          Register
        </Button>
      </Box>
    </Container>
  );
};

export default Register;
